parcel.on('playerenter', e => {
    fetch('https://us-central1-nlwpower.cloudfunctions.net/getAds')
   .then(response => response.json())
   .then(data=> {     
     console.log('get my data', data);       
     let adcount = data.length;

     if (adcount > 0){
        adOne.set({'url':data[0].data.ad_media_url});
        adOne.set({'link': data[0].data.ad_link_url}); 

        /*
        if (adcount > 1){
            adTwo.set({'url':data[1].data.ad_media_url});
            adTwo.set({'link': data[1].data.ad_link_url}); 
        }
        */
     }

   });
})
